function RepresentativeInfo({ repInfo }) {
    return (
        <div>
            {repInfo.representative && repInfo.office && (
                <div>
                    <h2>{repInfo.representative.name}</h2>
                    <p>{repInfo.office.name}</p>
                    <p>{repInfo.representative.party}</p>
                    <p>{repInfo.office.district}</p>
                    <p>{repInfo.representative.channels}</p>
                    {repInfo.representative.channels.map((channel, index) =>
                        <div>
                            <p key={`channel-${index}`}>{channel.type}</p>
                            <p>{channel.id}</p>
                        </div>
                    )}
                </div>
            )}
        </div>
    );
}

export default RepresentativeInfo;
